<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Moog Matriarch Patch Recall</title>
  <style>
        body {
      margin: 0;
      background: #fff;
      display: flex;
      flex-direction: column;
      align-items: center;
      font-family: 'Bahnschrift', sans-serif;
	  font-weight: 350;
	  font-stretch: condensed;
    }

    /* Inputs, textareas, buttons all share the font */
    input,
    textarea,
    button,
    label {
      font-family: 'Bahnschrift', sans-serif;
	  font-weight: 350;
	  font-stretch: condensed;
    }

    /* Placeholder text matches normal text */
    input::placeholder,
    textarea::placeholder {
      font-family: 'Bahnschrift', sans-serif;
	  font-weight: 350;
	  font-stretch: condensed;
      font-style: normal; /* optional: removes italic */
      color: #888;        /* optional: softer gray */
    }
    svg {
      width: 95vw;
      height: auto;
      border: 2px solid #000;
      background: #FFF;
	  user-select: none;      /* Prevent text selection */
  -webkit-user-select: none; /* Safari/Chrome */
  -moz-user-select: none;    /* Firefox */
  -ms-user-select: none;     /* IE/Edge */
    }
    /* Save button styling */
#button-container {
  display: flex;
  gap: 5px; /* space between buttons */
  justify-content: center; /* optional, centers buttons horizontally */
  margin-top: 2px;
}

#save-json,
#export-png,
#recall-json {
  width: 130px;
  height: 30px;
  font-size: 18px;
  font-weight: normal;
  background-color: #ddd;
  color: black;
  border: 0.5px solid #555;
  border-radius: 1.5px;
  cursor: pointer;
  text-align: center;
}

#save-json:hover,
#export-png:hover,
#recall-json:hover {
  background-color: #aaa;
}


  </style>
</head>
<body>
  <!-- Main container -->
  <div id="app-container" style="width: 95vw; display: flex; flex-direction: column; gap: 4px;">

    <!-- Patch Name + Buttons -->
    <div style="display: flex; align-items: center; gap: 10px;">
      <label for="patch-name" style="flex-shrink: 0; min-width: 80px;">Patch Name:</label>
      <input id="patch-name" type="text" placeholder="Enter patch name" style="flex: 1;">

      <div id="button-container" style="display: flex; gap: 5px;">
        <button id="recall-json">Load</button>
        <button id="save-json">Save</button>
		<button id="export-png">Export PNG</button>
      </div>
    </div>

    <!-- Patch Notes -->
    <div style="display: flex; flex-direction: column; width: 100%;">
      <label for="patch-notes">Patch Notes:</label>
      <textarea id="patch-notes" rows="5" style="width: 100%;"></textarea>
    </div>

// --- Cable logic with configurable colors + color pulsing ---
let startPoint = null;
let selectedPointEl = null;
const cables = [];
const cableColors = ["#c52626","#328539","#202f91","#d18500","#7741c4","#0fa3ba","#f23d61","#3d4700","#9c0374","#ff6f00"];
let cableCounter = 0;

// Configurable highlight colors for each patch point type
const highlightColors = {
  input: { selected: "#d61818", eligible: "#ffb58d" },
  output: { selected: "#d61818", eligible: "#7ff0ca" },
  mult: { selected: "#d61818", eligible: "#8f9bec" }
};

// Map of pulsing elements and their intervals
const pulseMap = new Map();

// Utility: brighten hex color by a percentage
function brightenHex(hex, percent) {
  const num = parseInt(hex.slice(1),16);
  let r = (num >> 16) + Math.round(255 * percent/100);
  let g = ((num >> 8) & 0xFF) + Math.round(255 * percent/100);
  let b = (num & 0xFF) + Math.round(255 * percent/100);
  r = Math.min(255, r); g = Math.min(255, g); b = Math.min(255, b);
  return `rgb(${r},${g},${b})`;
}

// Start pulsing color for a patch point
function startPulse(el, baseColor) {
  let step = 0;
  const interval = setInterval(() => {
    const factor = Math.sin(step) * 18; // oscillate +/-10%
    el.setAttribute('fill', brightenHex(baseColor, factor));
    step += 0.2;
  }, 42);
  pulseMap.set(el, interval);
}

// Stop pulsing
function stopPulse(el, baseColor) {
  if (pulseMap.has(el)) {
    clearInterval(pulseMap.get(el));
    pulseMap.delete(el);
  }
  el.setAttribute('fill', baseColor);
}

// Handle patch point clicks
function onPatchPointClick(point) {
  // Reset previous highlights and stop pulses
  if (selectedPointEl) {
    const resetColor = startPoint.type === 'input' ? '#ffc7a9' : startPoint.type === 'output' ? '#afe0d0' : '#b5bad9';
    selectedPointEl.setAttribute('fill', resetColor);

    patchPoints.forEach(p => {
      const el = document.getElementById(p.id);
      const baseColor = p.type === 'input' ? '#ffc7a9' : p.type === 'output' ? '#afe0d0' : '#b5bad9';
      stopPulse(el, baseColor);
    });

    selectedPointEl = null;
  }

  // First click: select starting point
if (!startPoint) {
  startPoint = point;

  // Highlight selected point
  selectedPointEl = document.getElementById(point.id);
  selectedPointEl.setAttribute('fill', highlightColors[point.type].selected);

  // Highlight eligible destinations and pulse them
  patchPoints.forEach(p => {
    const el = document.getElementById(p.id);
    if (p.id !== point.id && (p.type !== point.type || p.type === 'mult')) {
      const base = highlightColors[p.type].eligible;
      startPulse(el, base);
    } else if (p.id !== point.id) {
      // Ineligible points → grey
      stopPulse(el, "#d9d9d9"); // remove any previous pulse
      el.setAttribute('fill', "#cbcbcb");
    }
  });

  return;
}


  // Cancel if same point or same type (non-mult)
  if (startPoint.id === point.id || (startPoint.type === point.type && startPoint.type !== 'mult')) {
    startPoint = null;
    return;
  }

  // Create cable
  createCable(startPoint, point);

  // Reset highlights and stop pulses
  startPoint = null;
  selectedPointEl = null;
  patchPoints.forEach(p => {
    const el = document.getElementById(p.id);
    const baseColor = p.type === 'input' ? '#ffc7a9' : p.type === 'output' ? '#afe0d0' : '#b5bad9';
    stopPulse(el, baseColor);
  });
}

// Function to create a cable
function createCable(p1, p2) {
  const cable = document.createElementNS("http://www.w3.org/2000/svg", "path");
  const color = cableColors[cableCounter % cableColors.length];
  cableCounter++;

  cable.setAttribute("stroke", color);
  cable.setAttribute("fill", "transparent");
  cable.setAttribute("stroke-width", 2);
  cable.setAttribute("stroke-linecap", "round");
  cable.style.pointerEvents = "stroke";

  const dx = p2.x - p1.x;
  let d;

  if (Math.abs(dx) < 1) { // vertical cable
    const offsetX = 15;
    const midY = (p1.y + p2.y) / 2;
    d = `M ${p1.x} ${p1.y} Q ${p1.x + offsetX} ${p1.y} ${p1.x + offsetX} ${midY} Q ${p1.x + offsetX} ${p2.y} ${p2.x} ${p2.y}`;
  } else {
    const controlX = (p1.x + p2.x) / 2;
    const arcHeight = 40;
    const controlY = Math.min(p1.y, p2.y) - arcHeight;
    d = `M ${p1.x} ${p1.y} Q ${controlX} ${controlY} ${p2.x} ${p2.y}`;
  }

  cable.setAttribute("d", d);
  svg.appendChild(cable);
  cables.push({ from: p1.id, to: p2.id, color, d });

  // Double-click removes cable
  cable.addEventListener("dblclick", () => {
    cable.remove();
    const index = cables.findIndex(c => c.d === d && c.from === p1.id && c.to === p2.id);
    if (index > -1) cables.splice(index, 1);
  });
}


// Render patch points
patchPoints.forEach(p => {
  const el = document.createElementNS("http://www.w3.org/2000/svg", "circle");
  el.setAttribute("id", p.id);
  el.setAttribute("cx", p.x);
  el.setAttribute("cy", p.y);
  el.setAttribute("r", 1.7);
  el.setAttribute("fill", p.type === 'input' ? "#ffc7a9" : p.type === 'output' ? "#afe0d0" : "#b5bad9");
  svg.appendChild(el);

  const hit = document.createElementNS("http://www.w3.org/2000/svg", "circle");
  hit.setAttribute("cx", p.x);
  hit.setAttribute("cy", p.y);
  hit.setAttribute("r", 3.5);
  hit.setAttribute("fill", "transparent");
  hit.setAttribute("pointer-events", "all");
  hit.style.cursor = "pointer";
  hit.addEventListener("click", () => onPatchPointClick(p));
  svg.appendChild(hit);
});

    // Universal knob logic (mouse + touch)
function makeKnob(id, options={}) {
  const knob = document.getElementById(id);
  let isDragging = false;
  let startY, startAngle;
  let currentAngle = options.startAngle || 0;
  const minAngle = options.minAngle ?? -150;
  const maxAngle = options.maxAngle ?? 150;
  const sensitivity = options.sensitivity ?? 0.75;

  function getCenter() {
    const knobX = parseFloat(knob.getAttribute("x"));
    const knobY = parseFloat(knob.getAttribute("y"));
    const knobW = parseFloat(knob.getAttribute("width"));
    const knobH = parseFloat(knob.getAttribute("height"));
    return { cx: knobX + knobW / 2, cy: knobY + knobH / 2 };
  }

  function onMove(y) {
    const deltaY = startY - y;
    currentAngle = startAngle + deltaY / sensitivity;
    currentAngle = Math.max(minAngle, Math.min(maxAngle, currentAngle));
    const { cx, cy } = getCenter();
    knob.setAttribute("transform", `rotate(${currentAngle} ${cx} ${cy})`);
  }

  // Desktop
  knob.addEventListener("mousedown", e => { 
    e.preventDefault(); 
    isDragging = true; 
    startY = e.clientY; 
    startAngle = currentAngle; 
  });
  document.addEventListener("mousemove", e => { if(isDragging) onMove(e.clientY); });
  document.addEventListener("mouseup", () => { isDragging = false; });

  // Touch
  knob.addEventListener("touchstart", e => {
    e.preventDefault();
    isDragging = true;
    startY = e.touches[0].clientY;
    startAngle = currentAngle;
  }, {passive:false});

  document.addEventListener("touchmove", e => {
    if (!isDragging) return;
    e.preventDefault();
    onMove(e.touches[0].clientY);
  }, {passive:false});

  document.addEventListener("touchend", () => { isDragging = false; });
}



    // Selector knob logic (mouse + touch)
function makeSelectorKnob(id, angles, options={}) {
  const knob = document.getElementById(id);
  let isDragging = false;
  let startY, startIndex = 0;
  const sensitivity = options.sensitivity ?? 20;
  const defaultAngle = options.defaultAngle ?? angles[0];

  function getCenter() {
    const knobX = parseFloat(knob.getAttribute("x"));
    const knobY = parseFloat(knob.getAttribute("y"));
    const knobW = parseFloat(knob.getAttribute("width"));
    const knobH = parseFloat(knob.getAttribute("height"));
    return { cx: knobX + knobW / 2, cy: knobY + knobH / 2 };
  }

  startIndex = angles.indexOf(defaultAngle);
  if (startIndex === -1) startIndex = 0;
  const { cx, cy } = getCenter();
  knob.setAttribute("transform", `rotate(${angles[startIndex]} ${cx} ${cy})`);

  function onMove(y) {
    const deltaY = startY - y;
    let step = Math.round(deltaY / sensitivity);
    let index = startIndex + step;
    index = Math.max(0, Math.min(angles.length - 1, index));
    const { cx, cy } = getCenter();
    knob.setAttribute("transform", `rotate(${angles[index]} ${cx} ${cy})`);
  }

  // Desktop
  knob.addEventListener("mousedown", e => {
    e.preventDefault();
    isDragging = true;
    startY = e.clientY;
    const transform = knob.getAttribute("transform");
    const match = transform ? transform.match(/rotate\((-?\d+)/) : null;
    const currentAngle = match ? parseFloat(match[1]) : angles[0];
    startIndex = angles.reduce((prev, curr, i) => 
      Math.abs(curr - currentAngle) < Math.abs(angles[prev] - currentAngle) ? i : prev, 0);
  });
  document.addEventListener("mousemove", e => { if(isDragging) onMove(e.clientY); });
  document.addEventListener("mouseup", () => { isDragging = false; });

  // Touch
  knob.addEventListener("touchstart", e => {
    e.preventDefault();
    isDragging = true;
    startY = e.touches[0].clientY;
    const transform = knob.getAttribute("transform");
    const match = transform ? transform.match(/rotate\((-?\d+)/) : null;
    const currentAngle = match ? parseFloat(match[1]) : angles[0];
    startIndex = angles.reduce((prev, curr, i) => 
      Math.abs(curr - currentAngle) < Math.abs(angles[prev] - currentAngle) ? i : prev, 0);
  }, {passive:false});

  document.addEventListener("touchmove", e => {
    if (!isDragging) return;
    e.preventDefault();
    onMove(e.touches[0].clientY);
  }, {passive:false});

  document.addEventListener("touchend", () => { isDragging = false; });
}


    // Fader logic (mouse + touch)
function makeFader(id, minY, maxY) {
  const fader = document.getElementById(id);
  let isDragging = false;
  let startY, startFaderY;
  let y = (minY + maxY) / 2;
  fader.setAttribute("y", y);

  function onMove(cursorY) {
    let delta = cursorY - startY;
    const sensitivity = 2; // smaller = faster, larger = slower
    y = startFaderY + delta / sensitivity;
    y = Math.max(minY, Math.min(maxY, y));
    fader.setAttribute("y", y);
  }

  // Desktop
  fader.addEventListener("mousedown", e => {
    e.preventDefault();
    isDragging = true;
    const pt = svg.createSVGPoint();
    pt.x = e.clientX; pt.y = e.clientY;
    const cursor = pt.matrixTransform(svg.getScreenCTM().inverse());
    startY = cursor.y;
    startFaderY = y;
  });

  document.addEventListener("mousemove", e => { if (isDragging) {
    const pt = svg.createSVGPoint();
    pt.x = e.clientX; pt.y = e.clientY;
    const cursor = pt.matrixTransform(svg.getScreenCTM().inverse());
    onMove(cursor.y);
  }});

  document.addEventListener("mouseup", () => { isDragging = false; });

  // Touch
  fader.addEventListener("touchstart", e => {
    e.preventDefault();
    isDragging = true;
    const pt = svg.createSVGPoint();
    pt.x = e.touches[0].clientX; pt.y = e.touches[0].clientY;
    const cursor = pt.matrixTransform(svg.getScreenCTM().inverse());
    startY = cursor.y;
    startFaderY = y;
  }, {passive:false});

  document.addEventListener("touchmove", e => {
    if (!isDragging) return;
    e.preventDefault();
    const pt = svg.createSVGPoint();
    pt.x = e.touches[0].clientX; pt.y = e.touches[0].clientY;
    const cursor = pt.matrixTransform(svg.getScreenCTM().inverse());
    onMove(cursor.y);
  }, {passive:false});

  document.addEventListener("touchend", () => { isDragging = false; });
}

    e.preventDefault();

    pt.x = e.touches[0].clientX; pt.y = e.touches[0].clientY;
    const cursor = pt.matrixTransform(svg.getScreenCTM().inverse());
    startY = cursor.y;
    startWheelY = y;
  }, {passive:false});

  document.addEventListener("touchmove", e => {
    if (!isDragging) return;
    e.preventDefault();
    const pt = svg.createSVGPoint();
    pt.x = e.touches[0].clientX; pt.y = e.touches[0].clientY;
    const cursor = pt.matrixTransform(svg.getScreenCTM().inverse());
    onMove(cursor.y);
  }, {passive:false});

  document.addEventListener("touchend", () => { isDragging = false; });
}

    // Button logic

controls.forEach(ctrl => {
  const img = document.createElementNS("http://www.w3.org/2000/svg", "image");
  img.setAttribute("id", ctrl.id);
  img.setAttribute("href", typeToImage[ctrl.type]);
  img.setAttribute("x", ctrl.x);
  img.setAttribute("y", ctrl.y);
  img.setAttribute("width", ctrl.w);
  img.setAttribute("height", ctrl.h);
  svg.appendChild(img);

  switch(ctrl.type){
    case 'rotary':
    case 'filter': makeKnob(ctrl.id); break;
    case 'selector': makeSelectorKnob(ctrl.id, ctrl.angles, { defaultAngle: ctrl.defaultAngle }); break;
    case 'fader': makeFader(ctrl.id, ctrl.minY, ctrl.maxY); break;
    case 'modwheel': makeModwheel(ctrl.id, ctrl.minY, ctrl.maxY); break;
    case 'switch': makeSwitch(ctrl.id); break;
    case 'button': makeButton(ctrl.id); break;
    case 'led': makeLED(ctrl.id); break;
  }
});

// --- JSON Export ---
function saveAsJSON() {
  const patchName = document.getElementById('patch-name').value;
  const patchNotes = document.getElementById('patch-notes').value;

  const data = {
    name: patchName,
    notes: patchNotes,
    patchPoints,
    controls: controls.map(ctrl => {
      const el = document.getElementById(ctrl.id);
      const copy = { ...ctrl };
      switch (ctrl.type) {
        case 'rotary':
        case 'filter':
        case 'selector':
          copy.transform = el.getAttribute("transform");
          break;
        case 'fader':
        case 'modwheel':
          copy.y = parseFloat(el.getAttribute("y"));
          break;
        case 'switch':
        case 'button':
        case 'led':
          copy.href = el.getAttribute("href");
          break;
      }
      return copy;
    }),
    cables: Array.from(svg.querySelectorAll("path")).map(path => ({
      d: path.getAttribute("d"),
      color: path.getAttribute("stroke")
    }))
  };

  const blob = new Blob([JSON.stringify(data, null, 2)], { type: "application/json" });
  const url = URL.createObjectURL(blob);

  // Use patch name for filename if provided
  const fileName = patchName.trim() ? patchName.trim() + '.json' : 'Matriarch Patch.json';

  const a = document.createElement("a");
  a.href = url;
  a.download = fileName;
  a.click();
  URL.revokeObjectURL(url);
}

document.getElementById('save-json').addEventListener('click', saveAsJSON);


// --- JSON Recall ---
const recallBtn = document.getElementById('recall-json');
const recallFileInput = document.getElementById('recall-file');
const patchNameInput = document.getElementById('patch-name');
const patchNotesInput = document.getElementById('patch-notes');

recallBtn.addEventListener('click', () => recallFileInput.click());

recallFileInput.addEventListener('change', (event) => {
  const file = event.target.files[0];
  if (!file) return;

  const reader = new FileReader();
  reader.onload = (e) => {
    try {
      const data = JSON.parse(e.target.result);

      // Restore patch name and notes
      patchNameInput.value = data.name || '';
      patchNotesInput.value = data.notes || '';

      // Remove existing cables from SVG
      svg.querySelectorAll('path').forEach(p => p.remove());
      cables.length = 0;

      // Restore cables with dblclick removal
      if (Array.isArray(data.cables)) {
        data.cables.forEach(c => {
          const cable = document.createElementNS("http://www.w3.org/2000/svg", "path");
          cable.setAttribute("d", c.d);
          cable.setAttribute("stroke", c.color);
          cable.setAttribute("fill", "transparent");
          cable.setAttribute("stroke-width", 2);
          cable.setAttribute("stroke-linecap", "round");

          // Only the line is clickable
          cable.style.pointerEvents = "stroke";

          // Attach double-click handler
          cable.addEventListener("dblclick", () => {
            cable.remove();
            const index = cables.findIndex(e => e.d === c.d && e.from === c.from && e.to === c.to);
            if (index > -1) cables.splice(index, 1);
          });

          svg.appendChild(cable);
          cables.push(c);
        });
      }

      // Restore controls
      if (Array.isArray(data.controls)) {
        data.controls.forEach(ctrl => {
          const el = document.getElementById(ctrl.id);
          if (!el) return;
          switch(ctrl.type){
            case 'rotary':
            case 'filter':
            case 'selector':
              el.setAttribute("transform", ctrl.transform);
              break;
            case 'fader':
            case 'modwheel':
              el.setAttribute("y", ctrl.y);
              break;
            case 'switch':
            case 'button':
            case 'led':
              el.setAttribute("href", ctrl.href);
              break;
          }
        });
      }

    } catch(err) {
      alert('Invalid JSON file!');
      console.error(err);
    }
  };
  reader.readAsText(file);
});
</script>

    URL.revokeObjectURL(url);

    // Export PNG
    canvas.toBlob((blob) => {
      const a = document.createElement('a');
      a.href = URL.createObjectURL(blob);
      a.download = filename;
      a.click();
      URL.revokeObjectURL(a.href);
    }, 'image/png');
  };
  img.src = url;
});
</script>




</body>
</html>
